import React from 'react';
import { Header, Image } from 'semantic-ui-react'

const Nav = () => {
    return (
        <Header as='h2'>
            <Image circular src='./assets/headshot2_edited.png' />Sage Jordan
        </Header>
    )
}

export default Nav;
